#include <SPI.h>
#include <Wire.h>
#include <Adafruit_GFX.h>
#include <Adafruit_SSD1306.h>
#include "SenseBoxMCU.h"
#include <Plot.h>

const double TIMEFRAME = 50;


#define OLED_RESET 4
Adafruit_SSD1306 display(OLED_RESET);
BMP280 bmp_sensor;
Plot DataPlot(&display);






void setup() {
senseBoxIO.powerI2C(true);
delay(2000);
display.begin(SSD1306_SWITCHCAPVCC, 0x3D);
display.display();
delay(100);
display.clearDisplay();bmp_sensor.begin();DataPlot.setTitle("");
DataPlot.setXLabel("");
DataPlot.setYLabel("");
DataPlot.setXRange(0,15);
DataPlot.setYRange(0,50);
DataPlot.setXTick(0);
DataPlot.setYTick(0);
DataPlot.setXPrecision(0);
DataPlot.setYPrecision(0);


}


void loop() {
display.clearDisplay();
  DataPlot.clear();double starttime = millis();
  double t = 0;
  while (t <= TIMEFRAME) {
  t = (millis() - starttime) / 1000.0;
  float value = bmp_sensor.getTemperature();
  DataPlot.addDataPoint(t,value);
  }
display.display();

}

